    return (
    <Hero size="large">
      <Hero.Head renderAs="header">
          <Menu/>
      </Hero.Head>
      <Hero.Body >
        <Columns>
        <Columns.Column>
          x
        </Columns.Column>
        </Columns>
        <div>
         <h1>Hybrid Insurance</h1>
         <h2>Adaptive insurance for you & your vehicle - we've got you covered</h2>
        </div>
      </Hero.Body>
      <Hero.Footer>
        <div className="bd-notification is-danger"></div>
      </Hero.Footer>
    </Hero>
    )
    }
export default HeroComponent
